  false,\n\t\"url\": null,\n\t\"notes\": \"This report provides results of the 2012
  San Francisco Estuary Midwinter Waterfowl Survey and presents an analysis of trends
  in waterfowl counts from 1981-2012. The purpose of the MWS is to assess the distribution
  of wintering waterfowl and to provide a long-term dataset for assessing wintering
  population trends. The report describes a new GPS-enabled aerial survey methodology
  that was piloted in the SF Estuary in 2012 to improve data quality and utility.
  Recommendations are provided for improving the sampling design of the survey.\",\n\t\"license_title\":
